import React from 'react'

export default function Step2(props) {
    return (
        <div>
            <h2>Now we need some details about your book!</h2>
            <h3>(Be honest with the description and reasonable with the price, because 
                this book will help someone on your campus!)
            </h3>
            <p>
                Email:{" "}
                <input
                name="email"
                value={props.getState("email", "")}
                onChange={props.handleChange}
                />
            </p>
            <p>
                Phone:{" "}
                <input
                name="phone"
                value={props.getState("phone", "")}
                onChange={props.handleChange}
                />
            </p>
            <p>
                <button onClick={props.prev}>Previous</button>
                <button onClick={props.next}>Next</button>
            </p>
        </div>
    )
}
